/***** Private Definitions *****/

#define BIGNUM      65535
#define CL_SIZE     2048
#define CL_COUNT    2000
#define FS_SIZE     ( CL_SIZE * CL_COUNT )

typedef struct dt_entry {
    char name[112];
    uint32_t index; // index of the first cluster for the file
    uint32_t size; // size of the file
    uint32_t type; // 0x0000 = file, 0xFFFF = directory
    uint32_t time; // creation date (unix epoch format)
} dt_entry_t;

/***** Globals *****/
uint32_t fs_index;
uint32_t *boot_record;
dt_entry_t *dir_table;
int dir_table_size;
uint16_t *fat;
uint8_t *fs = 0;

/****** Navigating the Filesystem *****/
int read_data( uint16_t, uint8_t**, size_t );
void write_data( uint16_t, uint8_t *, size_t );
int tempread( void*, size_t, size_t );
int tempwrite( const void*, size_t, size_t );
void tempseek( uint32_t );
int get_dt_index( char * );
int get_free_fat( void );
int get_free_dt( void );
void clear_fat_chain( int );
void write_dt( void );
void write_fat( void );

/***** Begin Init *****/
int _fs_init( void ) {
    int i;
    fs_index = 0;
    
    if (!fs) {
        // data is the 'disk'
        fs = memget( FS_SIZE );
        
        boot_record = memget(4*sizeof(uint32_t));
        // configure boot record
        // [0] = cluster size
        // [1] = fs size
        // [2] = dt index
        // [3] = fat index
        boot_record[0] = CL_SIZE;
        boot_record[1] = FS_SIZE;
        boot_record[2] = 1;
        boot_record[3] = 2;
        
        printf("fs initialized\nsize: %d\ncluster size:%d\ncluster count:%d\n",
               FS_SIZE, CL_SIZE, CL_COUNT);
        
        dir_table_size = CL_SIZE/sizeof(dt_entry_t);
        dir_table = memget( CL_SIZE );
        for (i = 0; i < dir_table_size; ++i) {
            dir_table[i].name[0] = 0;
        }
        
        fat = memget(CL_COUNT*sizeof(uint16_t));
        // Clear FAT
        memset(fat, 0x00, CL_COUNT*sizeof(uint16_t));
        
        // First 3 clusters occupied (BR, DT, FAT)
        memset(fat, 0xFF, 3*sizeof(uint16_t));
        
        
        // Write BR
        tempseek(0);
        tempwrite( fat, CL_SIZE, 1 );
        
        // Write DT
        tempseek( boot_record[2]*CL_SIZE );
        tempwrite( dir_table, CL_SIZE, 1 );
        
        // Write FAT
        tempseek( boot_record[3]*CL_SIZE );
        tempwrite( fat, CL_SIZE, 1 );
        
        fs_file_t * file = newFile( "testimg" );
        printf("testimg size: %d\n", sizeof(testimg));
        file->size = sizeof( testimg );
        file->data = memget( file->size );
        memcpy( file->data, testimg, file->size );
        closeFile( file );
        
        fs_file_t * file2 = newFile( "colortestimg" );
        printf("colortestimg size: %d\n", sizeof(colortestimg));
        file->size = sizeof( colortestimg );
        file->data = memget( file->size );
        memcpy( file->data, colortestimg, file->size );
        closeFile( file2 );
        
        
    }
    return 0;
}

int tempread( void* buffer, size_t size, size_t n ) {
    int i;
    
    for (i = 0; i < (size*n); ++i) {
        ((uint8_t*)buffer)[i] = fs[fs_index+i];
    }
    
    fs_index += i;
    return fs_index;
}

int tempwrite( const void* buffer, size_t size, size_t n ) {
    int i;
    
    for (i = 0; i < (n*size); ++i) {
        fs[fs_index+i] = ((uint8_t*)buffer)[i];
    }
    
    fs_index += i;
    return fs_index;
}

void tempseek( uint32_t offset ) {
    fs_index = offset;
}

int get_dt_index( char * filename ) {
    int i;
    
    for (i = 0; i < dir_table_size; ++i) {
        if (strncmp(dir_table[i].name, filename, 112) == 0) {
            return i;
        }
    }
    
    return -1;
}

int get_free_fat( void ) {
    int i;
    
    for (i = 0; i < CL_COUNT; ++i) {
        if (fat[i] == 0) {
            return i;
        }
    }
    
    return -1;
}

int get_free_dt( void ) {
    int i;
    
    for (i = 0; i < dir_table_size; ++i) {
        if (dir_table[i].name[0] == 0 || dir_table[i].name[0] == 0xFF) {
            return i;
        }
    }
    
    return -1;
}

void clear_fat_chain( int start_index ) {
    int current_cluster = start_index;
    
    int next_cluster;
    while (fat[current_cluster] != 0xFFFF) {
        next_cluster = fat[current_cluster];
        fat[current_cluster] = 0x0000;
        current_cluster = next_cluster;
    }
    fat[current_cluster] = 0x0000;
}

int read_data( uint16_t cluster_index, uint8_t** buffer, size_t size ) {
    int dsize = CL_SIZE;
    uint8_t *data = memget(dsize);
    uint8_t *currentPos = data;
    int i = 0;
    
    while (cluster_index != 0xffff) {
        tempseek( cluster_index*CL_SIZE );
        if ( i > 0 ) {
            int newsize = CL_SIZE*(i+1);
            uint8_t *temp = memget( newsize );
            memcpy( temp, data, dsize );
            
            memfree( data, dsize );
            dsize = newsize;
            data = temp;
        }
        ++i;
        
        tempread( currentPos, CL_SIZE, 1 );
        currentPos += CL_SIZE;
        cluster_index = fat[cluster_index];
    }
    
    memcpy(*buffer, data, size);
    
    memfree(data, dsize);
    
    return CL_SIZE*i;
}

void write_data( uint16_t first_cluster, uint8_t *data, size_t size ) {
    uint8_t *currentPos = data;
    size_t writeSize = size;
    size_t leftToWrite = size;
    
    if (CL_SIZE < size) {
        writeSize = CL_SIZE;
    }
    
    tempseek( first_cluster*CL_SIZE );
    tempwrite( currentPos, 1, writeSize );
    
    leftToWrite -= writeSize;
    
    int thisCluster = first_cluster;
    int nextCluster = 0;
    
    while ( leftToWrite > 0 ) {
        currentPos += writeSize;
        
        if (writeSize > leftToWrite) {
            writeSize = leftToWrite;
        }
        
        nextCluster = get_free_fat();
        fat[thisCluster] = nextCluster;
        
        tempseek( nextCluster*CL_SIZE );
        tempwrite( currentPos, 1, writeSize );
        
        thisCluster = nextCluster;
        leftToWrite -= writeSize;
        
    }
    
    fat[thisCluster] = 0xFFFF;
    
    
}

fs_file_t * openFile( char * filename ) {
    fs_file_t * result = memget( sizeof(fs_file_t) );
    
    dt_entry_t dt = dir_table[ get_dt_index( filename ) ];
    result->size = dt.size;
    result->data = memget(result->size);
    read_data( dt.index, &(result->data), result->size );
    
    return result;
}

fs_file_t * newFile( char * filename ) {
    
    fs_file_t * result;
    if (get_dt_index(filename) == -1) {
        result = memget( sizeof(fs_file_t) );
        
        int dti = get_free_dt();
        int fi = get_free_fat();
        
        result->dt_index = dti;
        int len = strnlen(filename, 112);
        strncpy(dir_table[dti].name, filename, len);
        dir_table[dti].name[len] = 0;
        dir_table[dti].index = fi;
        dir_table[dti].time = 0;
        dir_table[dti].size = 0;
        dir_table[dti].type = 0xFFFF;
        fat[fi] = 0xFFFF;
    } else {
        result = openFile( filename );
    }
    
    return result;
}

void closeFile( fs_file_t * file ) {
    // Save, then free
    dir_table[file->dt_index].size = file->size;
    write_data( dir_table[file->dt_index].index, file->data, file->size );
    memfree( file->data, file->size );
    memfree( file, sizeof(fs_file_t) );
    
}

void touch( char* filename ) {
    
    if (get_dt_index(filename) == -1) {
        int dti = get_free_dt();
        int fi = get_free_fat();
        
        int len = strnlen(filename, 112);
        strncpy(dir_table[dti].name, filename, len);
        dir_table[dti].name[len] = 0;
        dir_table[dti].index = fi;
        dir_table[dti].time = 0;
        dir_table[dti].size = 0;
        dir_table[dti].type = 0xFFFF;
        fat[fi] = 0xFFFF;
    }
    
    write_dt();
    write_fat();
    
}

void rm( char* filename ) {
    int dti = get_dt_index(filename);
    
    if (dti != -1) {
        dir_table[dti].name[0] = 0xFF;
        clear_fat_chain( dir_table[dti].index );
    }
}

void ls( void ) {
    int i;
    
    for (i = 0; i < dir_table_size; ++i) {
        if (dir_table[i].name[0] != 0 && dir_table[i].name[0] != 0xFF) {
            printf("%s\n", dir_table[i].name);
        }
    }
}

void cat( char* filename ) {
    int dti = get_dt_index( filename );
    
    if (dti != -1) {
        int current_cluster = dir_table[dti].index;
        int size = dir_table[dti].size;
        uint8_t *data = memget(size+1);
        read_data( current_cluster, &data, size );
        data[size] = 0;
        printf("%s\n", data);
        
        memfree( data, size );
    }
}

void fileappend( char* filename, char* content ) {
    int size = strnlen( content, BIGNUM );
    
    // Skip quotes if they were used to begin and end the string
    if (content[0] == '"' && content[size-1] == '"') {
        content[size-1] = 0;
        content++;
    }
    
    
    int dti = get_dt_index( filename );
    if (dti != -1) {
        dt_entry_t *cur = &dir_table[dti];
        
        uint8_t *buffer = memget( cur->size + size );
        read_data( cur->index, &buffer, cur->size );
        memcpy( buffer+(cur->size), content, size );
        write_data( cur->index, buffer, cur->size + size );
        
        cur->size += size;
    }
    write_dt();
    write_fat();
}

void df( void ) {
    printf("tempfs Statistics\n");
    printf("Cluster size (bytes): %d\n", CL_SIZE);
    printf("Total Clusters: %d\n", CL_COUNT);
    int used_clusters = 0;
    int i;
    for (i = 0; i < CL_COUNT; ++i) {
        if (fat[i] != 0x0000) {
            ++used_clusters;
        }
    }
    printf("Used Clusters: %d\n", used_clusters);
    printf("Available Clusters: %d\n", CL_COUNT-used_clusters);
    float percent = ((float)CL_COUNT-(float)used_clusters)*((float)100/(float)CL_COUNT);
    printf("Percentage Free: %f\n", percent);
    
    //printFAT();
    //printDT();
}

void stat( char * filename ) {
    int dti;
    
    dti = get_dt_index( filename );
    if ( dti != -1 ) {
        printf("\nFile: %s\n", dir_table[dti].name);
        printf("Size: %d\n", dir_table[dti].size);
        printf("Type: %s\n", dir_table[dti].type == 0xFFFF ? "File" : "Directory");
        printf("Starting Cluster: %d\n", dir_table[dti].index);
        //printf("Time: %d\n", dir_table[dti].time); // unused
    }
}

void write_dt( void ) {
    tempseek( CL_SIZE*boot_record[2] );
    tempwrite( dir_table, CL_SIZE, 1 );
}

void write_fat( void ) {
    tempseek( CL_SIZE*boot_record[3] );
    tempwrite( fat, CL_SIZE, 1 );
}
